import React from "react";
import { Button } from "reactstrap";
import "./style.css";
import InCartItem from "./InCartItem";

const Cart = () => {
  return (
    <div className="container cart col-lg-10">
      <div>
        <InCartItem />
        <InCartItem />
      </div>
      <div className="total">
        <p>Total: $200</p>
        <Button color="info">Pay</Button>
      </div>
    </div>
  );
};

export default Cart;
